#include <stdlib.h>
#include <string.h>

int* beautifulIndices(char* s, char* a, char* b, int k, int* returnSize) {
    int len_s = strlen(s), len_a = strlen(a), len_b = strlen(b);
    int* temp = (int*)malloc(sizeof(int) * len_s);
    int tempSize = 0;

    for (int i = 0; i <= len_s - len_a; ++i) {
        if (strncmp(&s[i], a, len_a) == 0) {
            for (int j = 0; j <= len_s - len_b; ++j) {
                if (strncmp(&s[j], b, len_b) == 0 && abs(i - j) <= k) {
                    temp[tempSize++] = i;
                    break;
                }
            }
        }
    }

    *returnSize = tempSize;
    int* result = (int*)malloc(sizeof(int) * tempSize);
    memcpy(result, temp, sizeof(int) * tempSize);
    free(temp);

    return result;
}
